    for (var name in districts) {
        districts[name].color = Raphael.getColor();
        (function (st, name) {
            st[0].style.cursor = "pointer";
            st[0].onmouseover = function () {
                if (name !== current) {
                    st.animate({fill: "#f4858a", stroke: "#ffffff"}, 500);
                    st.toFront();
                }
            };
            st[0].onmouseout = function () {
                if (name !== current) {
                    st.animate({fill: "#d5d5d5", stroke: "#a7a9ac"}, 500);
                    st.toFront();
                }
            };
            st[0].onclick = function () {
                var point = st.getBBox(0),
                    popup = document.getElementById("district-popup");

                if (current && name !== current) {
                    districts[current].animate({fill: "#d5d5d5", stroke: "#a7a9ac"}, 500);
                    document.getElementById(current).style.display = "";
                    popup.style.display = "";
                }
                current = name;
                st.animate({fill: "#f4858a", stroke: "#ffffff"}, 500);
                st.toFront();
                document.getElementById(current).style.display = "block";

                popup.innerHTML = districtsInfo[current]["name"] + "<br/>Центр округа &mdash; <b>" + districtsInfo[current]["cap"] + "</b>";
                popup.style.left = (point.x + (point.width / 2) - 100) + "px";
                popup.style.top = (point.y + (point.height / 2)) + "px";
                popup.style.display = "block";
            };

        })(districts[name], name);

    }
